/**
 * Extract and normalize quiz data from various input formats
 * @param {Object} rawData - Raw webhook data
 * @returns {Object} - Normalized quiz data
 */
function extractQuizData(rawData) {
  console.log('Extracting quiz data from:', JSON.stringify(rawData).substring(0, 200));

  // Direct structure
  if (rawData.quizId && rawData.responses) {
    console.log('Found direct quiz structure');
    return rawData;
  }

  // Check for nested body.data JSON string (double-wrapped data from frontend)
  if (rawData.body?.data && typeof rawData.body.data === 'string') {
    try {
      console.log('Found body.data as string, parsing...');
      return JSON.parse(rawData.body.data);
    } catch (e) {
      console.log('Error parsing body.data:', e.message);
    }
  }

  // Check for direct data property as string (common frontend pattern)
  if (rawData.data && typeof rawData.data === 'string') {
    try {
      console.log('Found data as string, parsing...');
      return JSON.parse(rawData.data);
    } catch (e) {
      console.log('Error parsing data string:', e.message);
    }
  }

  // Direct data property as object
  if (rawData.data?.quizId && rawData.data.responses) {
    console.log('Found quiz structure in data property');
    return rawData.data;
  }

  // Try to handle the Shopify quiz specific format
  if (rawData.body?.responses || rawData.responses) {
    const quizData = rawData.body || rawData;
    console.log('Found responses directly in body or root');
    return {
      quizId: quizData.quizId || 'unknown', quizTitle: quizData.quizTitle || 'Unknown Quiz', completedAt: quizData.completedAt || quizData.timestamp || new Date().toISOString(), responses: quizData.responses || []
    };
  }

  // Default case - return unchanged
  console.log('Using default data extraction case');
  return rawData;
}

/**
 * Enhanced email validation with detailed logging
 * @param {string} email - Email to validate
 * @returns {boolean} - Is email valid
 */
function isValidEmail(email) {
  // Basic validation
  if (!email || typeof email !== 'string') {
    console.log(`Email validation failed: ${!email ? 'Empty email' : 'Not a string'}`);
    return false;
  }

  // Normalize email
  email = email.trim().toLowerCase();
  if (email === '') {
    console.log('Email validation failed: Empty after trimming');
    return false;
  }

  // Format validation
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
  if (!emailRegex.test(email)) {
    console.log(`Email validation failed: Invalid format - ${email}`);
    return false;
  }

  // Length constraints
  if (email.length < 5 || email.length > 100) {
    console.log(`Email validation failed: Length (${email.length}) outside valid range`);
    return false;
  }

  // Domain validity
  const domain = email.split('@')[1];
  if (!domain || !domain.includes('.')) {
    console.log(`Email validation failed: Invalid domain - ${domain}`);
    return false;
  }

  return true;
}

/**
 * Extract answer safely from responses
 * @param {Array} responses - Quiz responses array
 * @param {string} questionId - Target question ID
 * @returns {*} - Answer value or null
 */
function extractAnswer(responses, questionId) {
  if (!responses || !Array.isArray(responses)) {
    return null;
  }
  const response = responses.find(r => r && r.questionId === questionId);
  return response ? response.answer : null;
}

/**
 * Main processing function
 */
function processQuizData() {
  // Extract raw data
  const rawData = $input.item.json;

  console.log('Processing raw data:', JSON.stringify(rawData).substring(0, 200));
  const quizData = extractQuizData(rawData);
  console.log('Extracted quiz data:', JSON.stringify(quizData).substring(0, 200));

  // Extract responses with safety checks
  const responses = quizData.responses || quizData.allResponses || [];
  console.log('Extracted responses:', JSON.stringify(responses).substring(0, 200));

  // Check if responses is an object with question IDs as keys (alternative format)
  let normalizedResponses = responses;
  if (!Array.isArray(responses) && typeof responses === 'object') {
    normalizedResponses = Object.entries(responses).map(([key, value]) => ({
      questionId: key,
      answer: value
    }));
    console.log('Normalized responses from object format:', JSON.stringify(normalizedResponses).substring(0, 200));
  }

  // Get customer information with consistent extraction
  let customerEmail = extractAnswer(normalizedResponses, 'q9') || '';
  const firstName = extractAnswer(normalizedResponses, 'q7') || '';
  const lastName = extractAnswer(normalizedResponses, 'q8') || '';
  const phoneNumber = extractAnswer(normalizedResponses, 'q10') || '';
  const state = extractAnswer(normalizedResponses, 'q5') || '';
  const insurance = extractAnswer(normalizedResponses, 'q3') || '';
  const insuranceMemberId = extractAnswer(normalizedResponses, 'q4') || '';
  const mainReason = extractAnswer(normalizedResponses, 'q1') || '';
  const secondaryReasons = extractAnswer(normalizedResponses, 'q2') || [];
  const dateOfBirth = extractAnswer(normalizedResponses, 'q6') || '';

  // Alternative direct extraction if responses is an object
  if (!Array.isArray(responses) && typeof responses === 'object') {
    if (!customerEmail) customerEmail = responses.q9 || '';
    // No need to add alternatives for other fields as they're already handled
  }

  // Normalize email with better safety
  if (customerEmail) {
    customerEmail = customerEmail.trim().toLowerCase();
    // Remove potentially problematic characters
    customerEmail = customerEmail.replace(/['\"`\\]/g, '');
  }

  // Validate email
  const isValidEmailResult = isValidEmail(customerEmail);
  if (!isValidEmailResult) {
    console.log(`Email validation failed for: ${customerEmail || '(empty)'}`);
  }

  // Build normalized data structure
  const formattedData = {
    quizId: quizData.quizId || 'unknown', quizTitle: quizData.quizTitle || 'Unknown Quiz', completedAt: quizData.completedAt || new Date().toISOString(), customerEmail, firstName, lastName, phoneNumber, dateOfBirth, isValidEmail: isValidEmailResult, state, insurance, insuranceMemberId, mainReason, secondaryReasons, allResponses: normalizedResponses
  };

  // Format date fields consistently
  try {
    const date = new Date(formattedData.completedAt);
    formattedData.formattedDate = date.toLocaleDateString();
    formattedData.formattedTime = date.toLocaleTimeString();
  } catch (e) {
    console.log('Error formatting date:', e.message);
    formattedData.formattedDate = '';
    formattedData.formattedTime = '';
  }

  // Convert option IDs to readable text
  formattedData.mainReasonText = REASON_MAP[formattedData.mainReason] || formattedData.mainReason || 'Unknown';

  // Format secondary reasons text
  if (Array.isArray(formattedData.secondaryReasons) && formattedData.secondaryReasons.length > 0) {
    formattedData.secondaryReasonsText = formattedData.secondaryReasons
      .map(id => REASON_MAP[id] || id || '')
      .filter(text => text.length > 0)
      .join(', ');
  } else {
    formattedData.secondaryReasonsText = '';
  }

  // Get readable insurance name
  formattedData.insuranceText = INSURANCE_MAP[formattedData.insurance] || formattedData.insurance || 'Unknown';

  // Prepare Klaviyo profile data in required format
  formattedData.klaviyoProfileData = {
    data: {
      type: "profile",
      attributes: {
        email: customerEmail,
        first_name: formattedData.firstName,
        last_name: formattedData.lastName,
        phone_number: formattedData.phoneNumber,
        properties: {
          "State": formattedData.state || '',
          "Insurance": formattedData.insuranceText || '',
          "Insurance Member ID": formattedData.insuranceMemberId || '',
          "Main Interest": formattedData.mainReasonText || '',
          "Secondary Interests": formattedData.secondaryReasonsText || '',
          "Quiz Source": formattedData.quizTitle || '',
          "Quiz Completed": formattedData.formattedDate || '',
          "$source": "Dietitian Quiz"
        }
      }
    }
  };

  return {json: formattedData};
}

// Execute main function
