/**
 * Format date of birth consistently for insurance APIs
 * @param {string} dobValue - Date of birth in any format
 * @returns {string} - Formatted date as YYYYMMDD
 */
function formatDateOfBirth(dobValue) {
  if (!dobValue) return '19000101';

  try {
    const date = new Date(dobValue);
    if (!isNaN(date.getTime())) {
      const year = date.getFullYear().toString();
      const month = (date.getMonth() + 1).toString().padStart(2, '0');
      const day = date.getDate().toString().padStart(2, '0');
      return `${year}${month}${day}`;
    }
  } catch (e) {
    console.log('Error formatting date of birth:', e.message);
  }

  return '19000101';
}

/**
 * Extract and normalize name fields with fallbacks
 * @param {Object} formattedData - Formatted quiz data
 * @returns {Object} - Object with firstName and lastName
 */
function extractNames(formattedData) {
  let firstName = formattedData.firstName || '';
  let lastName = formattedData.lastName || '';

  // Check responses if main fields are empty
  if ((!firstName || !lastName) && formattedData.allResponses) {
    // Handle both array and object formats for allResponses
    if (Array.isArray(formattedData.allResponses)) {
      const firstNameResponse = formattedData.allResponses.find(r => r.questionId === 'q7');
      const lastNameResponse = formattedData.allResponses.find(r => r.questionId === 'q8');

      if (firstNameResponse) firstName = firstNameResponse.answer || '';
      if (lastNameResponse) lastName = lastNameResponse.answer || '';
    } else if (typeof formattedData.allResponses === 'object') {
      // Direct object access for object format
      if (formattedData.allResponses.q7) firstName = formattedData.allResponses.q7 || '';
      if (formattedData.allResponses.q8) lastName = formattedData.allResponses.q8 || '';
    }
  }

  // Fallbacks for still-missing names
  if (!firstName) {
    firstName = formattedData.customerEmail ? 
      formattedData.customerEmail.split('@')[0] || 'Anonymous' : 
      'Anonymous';
  }

  if (!lastName) {
    lastName = 'Patient';
  }

  // Ensure valid values
  firstName = firstName.trim() || 'Anonymous';
  lastName = lastName.trim() || 'Patient';

  return { firstName, lastName };
}

