function prepareInsuranceRequest() {
  const formattedData = $input.item.json;

  // Get date of birth
  const dateOfBirth = formatDateOfBirth(formattedData.dateOfBirth);

  // Generate unique control number for request tracing
  const controlNumber = Date.now().toString().substring(0, 9);

  // Get provider information
  const insuranceId = formattedData.insurance || '';
  const npi = INSURANCE_NPI_MAP[insuranceId] || '1999999984';
  const tradingPartnerId = INSURANCE_PARTNER_MAP[insuranceId] || 'AHS';

  // Generate unique patient ID with validation
  const memberIdBase = formattedData.insuranceMemberId || '111222333';
  const externalPatientId = `UAA${memberIdBase.replace(/[^a-zA-Z0-9]/g, '')}`;

  // Extract name information with fallbacks
  const { firstName, lastName } = extractNames(formattedData);

  // Process member ID with validation
  const memberId = processMemberId(formattedData);

  // Prepare complete Stedi request body
  const stediRequestBody = {
    "controlNumber": controlNumber,
    "tradingPartnerServiceId": tradingPartnerId,
