      "dateOfBirth": dateOfBirth,
      "firstName": firstName,
      "lastName": lastName,
      "memberId": memberId
    }
  };

  // Return both original data and Stedi request
  return { json: { ...formattedData, stediRequestBody } };
}

// Execute main function
