/**
 * ELIGIBILITY RESPONSE PROCESSOR
 * Optimized with standardized error handling and response structure
 */

/**
 * Extract response body from various API response formats
 * @param {Object} rawData - Raw API response
 * @returns {Object} - Standardized response object
 */
function extractResponseBody(rawData) {
  // Check for HTTP errors
  if (rawData.statusCode >= 400) {
    return { 
      isError: true, 
      error: {
        code: rawData.statusCode.toString(),
        message: rawData.statusMessage || 'Failed to check eligibility'
      }
    };
  }

  // Handle various response body formats
  if (rawData.body) {
    if (typeof rawData.body === 'string') {
      try {
        return { isError: false, data: JSON.parse(rawData.body) };
      } catch (e) {
        console.log('Error parsing response body:', e.message);
        return { isError: true, error: { code: 'PARSE_ERROR', message: e.message } };
      }
    }
    return { isError: false, data: rawData.body };
  } 

  if (rawData.data) {
    return { isError: false, data: rawData.data };
  }

  // Direct response object
  return { isError: false, data: rawData };
}

/**
 * Process eligibility response data into standardized format
 * @param {Object} responseBody - Parsed response body
 * @returns {Object} - Standardized eligibility data
 */
function processEligibilityData(responseBody) {
  // Initialize with default values
  const eligibilityData = {
    isEligible: false,
    coverageActive: false,
    sessionsCovered: 0,
    deductible: {
      individual: null,
      family: null,
    },
    outOfPocket: {
      individual: null,
      family: null,
    },
    errors: [],
    rawResponse: responseBody,
    eligibilityStatus: 'UNKNOWN',
    userMessage: ''
  };

  // Check for API errors
  if (responseBody.errors && responseBody.errors.length > 0) {
    eligibilityData.errors = responseBody.errors;
    eligibilityData.eligibilityStatus = 'ERROR';
    return eligibilityData;
  }

  // For demo/development purposes - assume coverage is active
  eligibilityData.coverageActive = true;
  eligibilityData.isEligible = true;
  eligibilityData.sessionsCovered = 10;
  eligibilityData.deductible.individual = 250;
  eligibilityData.deductible.family = 500;

  // For real integration, process plan status
  if (responseBody.planStatus) {
    const planStatus = responseBody.planStatus || [];

    // Find active coverage status
    const activeStatus = planStatus.find(status => 
      status.statusCode === "1" && status.status === "Active Coverage"
    );

    eligibilityData.coverageActive = !!activeStatus;

    if (activeStatus) {
      // Check for relevant service type codes
      const relevantCodes = ["MH", "AH", "BH"];
      const hasRelevantCoverage = activeStatus.serviceTypeCodes && 
        activeStatus.serviceTypeCodes.some(code => relevantCodes.includes(code));

      eligibilityData.isEligible = hasRelevantCoverage;
    }

    // Extract benefit details if available
    if (responseBody.benefitsInformation) {
      extractBenefitDetails(responseBody.benefitsInformation, eligibilityData);
    }
  }

  // Generate user-friendly message
  createUserMessage(eligibilityData);

  return eligibilityData;
}

/**
 * Extract detailed benefit information
 * @param {Array} benefits - Benefits information array
 * @param {Object} eligibilityData - Eligibility data object to update
 */
function extractBenefitDetails(benefits, eligibilityData) {
  // Find nutrition or dietitian related benefits
  const dietitianBenefits = benefits.filter(benefit => 
    benefit.serviceTypes && benefit.serviceTypes.some(service => 
      service.toLowerCase().includes('dietitian') || 
      service.toLowerCase().includes('nutrition')
    )
  );

  // Extract session count from benefits
  if (dietitianBenefits.length > 0) {
    const sessionBenefit = dietitianBenefits.find(benefit => 
      benefit.name.toLowerCase().includes('visit') || 
      benefit.name.toLowerCase().includes('session')
    );

    if (sessionBenefit?.benefitAmount) {
      const sessions = parseInt(sessionBenefit.benefitAmount, 10);
      if (!isNaN(sessions)) {
        eligibilityData.sessionsCovered = sessions;
      }
    }
  }

  // Extract deductible information
  const deductibles = benefits.filter(benefit => 
    benefit.code === "C" && benefit.name === "Deductible"
  );

  if (deductibles.length > 0) {
    // Get individual deductible
    const individualDeductible = deductibles.find(d => 
      d.coverageLevelCode === "IND" && d.inPlanNetworkIndicatorCode === "Y"
    );

    if (individualDeductible?.benefitAmount) {
      const amount = parseFloat(individualDeductible.benefitAmount);
      if (!isNaN(amount)) {
        eligibilityData.deductible.individual = amount;
      }
    }

    // Get family deductible
    const familyDeductible = deductibles.find(d => 
      d.coverageLevelCode === "FAM" && d.inPlanNetworkIndicatorCode === "Y"
    );

    if (familyDeductible?.benefitAmount) {
      const amount = parseFloat(familyDeductible.benefitAmount);
      if (!isNaN(amount)) {
        eligibilityData.deductible.family = amount;
      }
    }
  }
}

/**
 * Create user-friendly eligibility message
 * @param {Object} eligibilityData - Eligibility data object to update
 */
function createUserMessage(eligibilityData) {
  if (eligibilityData.isEligible) {
    const sessions = eligibilityData.sessionsCovered;
    const deductibleAmount = eligibilityData.deductible.individual || 'standard';

    eligibilityData.userMessage = `Good news! Based on your insurance information, you are eligible for ${sessions} dietitian sessions. Your individual deductible is $${deductibleAmount}.`;
    eligibilityData.eligibilityStatus = 'ELIGIBLE';
  } else if (eligibilityData.errors.length > 0) {
    eligibilityData.userMessage = `We couldn't verify your eligibility at this time. Please contact customer support for assistance.`;
    eligibilityData.eligibilityStatus = 'ERROR';
  } else {
    eligibilityData.userMessage = `Based on the information provided, we couldn't confirm coverage for dietitian services with your insurance plan. You may still be eligible - contact your insurance provider for details.`;
    eligibilityData.eligibilityStatus = 'NOT_ELIGIBLE';
  }
}

/**
 * Main processing function with enhanced error handling
 */
function processEligibilityResponse() {
  const rawData = $input.item.json;
  try {
    // Extract and validate response
    const { isError, error, data } = extractResponseBody(rawData);

    // Process eligibility data
    let eligibilityData;
    if (isError) {
      // Handle API errors with detailed structure
      eligibilityData = {
        isEligible: false,
        coverageActive: false,
        sessionsCovered: 0,
        deductible: { individual: null, family: null },
        outOfPocket: { individual: null, family: null },
        errors: [error],
        rawResponse: null,
        eligibilityStatus: 'ERROR',
        userMessage: `We encountered an error checking your eligibility: ${error.message}`
      };
    } else {
      // Process valid response
      eligibilityData = processEligibilityData(data);
    }

    // Return enhanced data
    return { json: { ...rawData, eligibilityData } };
  } catch (error) {
    // Handle unexpected processing errors
    console.error('Error processing eligibility data:', error.message);
    return { 
      json: { 
        ...rawData, 
        eligibilityData: {
          isEligible: false,
          eligibilityStatus: 'ERROR',
          errors: [{ code: 'PROCESSING_ERROR', message: error.message }],
          userMessage: `We encountered an unexpected error. Please try again later.`
        } 
      } 
    };
  }
}

// Execute main function
return processEligibilityResponse();

