    return inputData.data.attributes.email;
  }

  // Deeply nested structure - common in API responses
  if (inputData.data?.data?.attributes?.email) {
    return inputData.data.data.attributes.email;
  }

  // KlaviyoProfileData handling with safety checks
  if (inputData.klaviyoProfileData) {
    if (typeof inputData.klaviyoProfileData === 'string') {
