/**
 * Optimized Shopify GraphQL request builder
 * @param {Object} data - Customer data 
 * @returns {Object} - Formatted Shopify request
 */
function prepareShopifyRequest(data) {
  // Use destructuring with defaults for cleaner code
  const {
    email = '',
    firstName = '',
    lastName = '',
    phoneNumber = '',
    quizId = '',
    quizTitle = 'Dietitian Quiz',
    state = '',
    mainReasonText = '',
    secondaryReasonsText = '',
    insuranceText = '',
    insuranceMemberId = '',
    completedAt = ''
  } = data;

  // Build metafields array conditionally to reduce payload size
  const metafields = [
    { namespace: "quiz", key: "quiz_id", value: quizId, type: "single_line_text_field" },
    { namespace: "quiz", key: "completed_at", value: completedAt, type: "single_line_text_field" }
  ];

  // Only add fields with values
  if (mainReasonText) {
    metafields.push({ 
      namespace: "quiz", 
      key: "main_interest", 
      value: mainReasonText, 
      type: "single_line_text_field" 
    });
  }

  if (secondaryReasonsText) {
    metafields.push({ 
      namespace: "quiz", 
      key: "secondary_interests", 
      value: secondaryReasonsText, 
      type: "single_line_text_field" 
    });
  }

  if (insuranceText) {
    metafields.push({ 
      namespace: "quiz", 
      key: "insurance_provider", 
      value: insuranceText, 
