/**
 * SHOPIFY API ERROR PROCESSOR
 * Optimized with standardized error handling and response structure
 */

/**
 * Process Shopify API responses to extract errors and success indicators
 * @param {Object} responseData - Raw Shopify API response
 * @returns {Object} - Standardized result object
 */
function processShopifyErrors(responseData) {
  // Initialize result structure
  const result = {
    success: true,
    customerCreated: false,
    customerId: null,
    errors: [],
    originalResponse: responseData
  };

  // Safety check for missing response
  if (!responseData) {
    result.success = false;
    result.errors.push({
      source: 'processing',
      code: 'MISSING_DATA',
      message: 'Response data is missing or undefined'
    });
    return result;
  }

  // Check for HTTP-level errors
  if (responseData.statusCode >= 400) {
    result.success = false;
    result.errors.push({
      source: 'shopify_api',
      code: responseData.statusCode.toString(),
      message: responseData.statusMessage || 'Shopify API error'
    });
    return result;
  }

  // Parse response body if needed
  let data = responseData.body;

  // Safety check for missing body
  if (data === undefined || data === null) {
    result.success = false;
    result.errors.push({
      source: 'response_format',
      code: 'MISSING_BODY',
      message: 'Response body is missing or undefined'
    });
    return result;
  }

  // Parse JSON string if needed
  if (typeof data === 'string') {
    try {
      data = JSON.parse(data);
    } catch (e) {
      result.success = false;
      result.errors.push({
        source: 'response_parsing',
        code: 'PARSE_ERROR',
        message: 'Failed to parse Shopify response'
      });
      return result;
    }
  }

  // Check for GraphQL-level errors
  if (data?.errors?.length > 0) {
    result.success = false;
    data.errors.forEach(error => {
      if (error) {
        result.errors.push({
          source: 'shopify_graphql',
          code: error.extensions?.code || 'GRAPHQL_ERROR',
          message: error.message || 'Unknown GraphQL error'
        });
      }
    });
    return result;
  }

  // Check for user errors in the response
  if (data?.data?.customerCreate?.userErrors?.length > 0) {
    result.success = false;
    data.data.customerCreate.userErrors.forEach(error => {
      if (error) {
        result.errors.push({
          source: 'shopify_mutation',
          code: 'USER_ERROR',
          field: error.field || '',
          message: error.message || 'Unknown user error'
        });
      }
    });
    return result;
  }

  // Extract customer ID if creation was successful
  if (data?.data?.customerCreate?.customer?.id) {
    result.success = true;
    result.customerCreated = true;
    result.customerId = data.data.customerCreate.customer.id;
  }

  return result;
}

