 * Main function with enhanced logging
 */
function processShopifyResponse() {
  const responseData = $input.item.json;
  // Add logging to help debug issues
  console.log('Processing Shopify response type:', typeof responseData);

  // Process response and return with standardized format
  const shopifyResult = processShopifyErrors(responseData);

